import './Swipe.css';
import SwipeItem from './SwipeItem';

function Swipe({swiper}) {

    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
    };

    return (
        <div className="swipe-container">
            <Slider {...settings}>
                {swiper.list.map((item) => (
                    <SwipeItem background={item.background} />
                ))}
            </Slider>
        </div>
    );
};

export default Swipe;
